import styled from 'styled-components';

export const StyledDashboardActions = styled.div`
  color: #fff;
  letter-spacing: 2px;
  .btn {
    border: 0;
    background: none;
    display: block;
    width: 200px;
    margin: 20px auto;
    text-align: center;
    border: 2px solid #cc2e43;
    padding: 14px 40px;
    outline: none;
    color: white;
    border-radius: 24px;
    transition: 0.25s;
    cursor: pointer;
    font-family: 'Abel', sans-serif;
  }
  .btn:hover {
    background: #cc2e43;
  }

  a {
    text-decoration: none;
  }
`;
